export const ProductsTable = (props) => {
  const { nameOfColumn, dataOfRows } = props;

  console.log(nameOfColumn);
  console.log(dataOfRows);

  return (
    <div>
      <table>
        <thead>
          {nameOfColumn.map((item) => (
            <th>
              <td>{item}</td>
            </th>
          ))}
        </thead>
        <tbody>
          {dataOfRows.map((data) => (
            <tr>
              <td>{data.id}</td>
              <td>{data.title}</td>
              <td>{data.descriptions}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
